src/SwapAbstract.sol.content:
// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.28;

import "https://github.com/Vectorized/solady/blob/main/src/tokens/ERC20.sol";

struct Permit2Sig {
    uint deadline;
    uint8 v;
    bytes32 r;
    bytes32 s;
}

abstract contract SwapAbstract {
    ERC20 public immutable asset;

    constructor(ERC20 asset_){
        asset = asset_;
    }

    function getERC20ToNativePrice(uint erc20sSold) public virtual view returns (uint nativesBought);
    function getNativeToERC20Price(uint nativesSold) public virtual view returns (uint erc20sBought);
    function erc20ToNativeSwap(uint erc20sSold, address recipient) public virtual returns (uint nativesBought);
    function nativeToERC20Swap(address recipient) public virtual payable returns (uint erc20sBought);

    function erc20ToNativeSwap(uint erc20sSold) public returns (uint nativesBought) {
        return erc20ToNativeSwap(erc20sSold, msg.sender);
    }

    function erc20ToNativeSwap(uint erc20sSold, Permit2Sig calldata sig) external returns (uint nativesBought) {
        asset.permit(msg.sender, address(this), erc20sSold, sig.deadline, sig.v, sig.r, sig.s);
        return erc20ToNativeSwap(erc20sSold);
    }

    function erc20ToNativeSwap(uint erc20sSold, address recipient, Permit2Sig calldata sig) public returns (uint nativesBought) {
        asset.permit(msg.sender, address(this), erc20sSold, sig.deadline, sig.v, sig.r, sig.s);
        return erc20ToNativeSwap(erc20sSold, recipient);
    }

    function nativeToERC20Swap() external payable returns (uint erc20sBought) {
        return nativeToERC20Swap(msg.sender);
    }
}

